import React, { useEffect, useState, useRef } from "react";
import { useSelector,useDispatch } from "react-redux";
import { Link } from "react-router-dom";
import {getMyOrders} from './../actions/products';
import CLoader from "./Layouts/CLoader";
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
const MyOrders = () => {
  const dispatch = useDispatch();
  const OrderData = useSelector(state => state.productsApi);
  console.log(OrderData);
  const products = (OrderData?.myOrderData?.data === undefined) ? [] : OrderData?.myOrderData?.data;
  useEffect(()=>{
    dispatch(getMyOrders());
  },[]);
  return (
  <>
  <div className="container mx-auto" style={{marginTop:'20px'}}>
    <div className="p-10 grid grid-cols-1 sm:grid-cols-1 md:grid-cols-4 lg:grid-cols-4 xl:grid-cols-4 gap-4">
      {
        (products?.length <= 0 || products?.length === undefined) ? <img src="https://i.pinimg.com/originals/c9/22/68/c92268d92cf2dbf96e3195683d9e14fb.png"/>: 
          products.map((product ,i) => {
            return (
              <div className="max-w-sm rounded overflow-hidden shadow-lg">
                <img className="w-full" src="" alt="" loading="lazy"/>
                <div className="px-6 py-4">
                  <div className="font-bold text-xl mb-2">
                    <Link to={`/view-product/`}>test</Link>
                  </div>
                  <p className="text-gray-700 text-base float-right">Rs 2 /-</p>
                  <p className="text-gray-700 text-base float-left">234234 </p>
                </div>
                <div className="px-6 pt-4 pb-2">
                  <span className="inline-block bg-gray-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700 mr-2 mb-2">#photography</span>
                  <span className="inline-block bg-gray-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700 mr-2 mb-2">#travel</span>
                  <span className="inline-block bg-gray-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700 mr-2 mb-2">#winter</span>
                </div>
                <center>
                  <button className="inline-flex items-center h-8 px-4 m-2 text-sm text-indigo-100 transition-colors duration-150 bg-indigo-700 rounded-lg focus:shadow-outline hover:bg-indigo-800">Add to Cart</button>
                </center>
              </div>
              )
          })
      }
    </div>
  </div>
  </>
  )
}

export default MyOrders
